import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import "primereact/resources/primereact.min.css";
import "primereact/resources/themes/tailwind-light/theme.css";  

const headerStyles = {
  backgroundColor: '#000',
  color: '#fff',
  display: 'flex',
  justifyContent: 'space-between',
  alignItems: 'center', // Add this line to vertically align items
  padding: '1rem',
};

const headerItemStyles = {
  padding: '0.5rem',
  cursor: 'pointer',
  display: 'flex', // Add this line to make the items inside flex container
  alignItems: 'center', // Add this line to vertically align items
};

export const navItems = [
  {
    title: 'Dashboard',
    submenu: [
      {
        title: 'SOG Dashboard',
        url: '/seaofgreen',
        menuRouteTitle:'/seaofgreen',
        parentTitle:'Dashboard',
      },
      {
        title: 'Incident Dashboard',
        url: '/',
        menuRouteTitle:'/',
        parentTitle:'Dashboard',
      }
    ],
  },
  {
      title: 'Configuration',
      submenuType:'horizontal',
      submenu: [
        {
          title: 'Hawkeye configuration',
          parentTitle:'Configuration',
          submenu: [
            {
              title: 'Data Source',
              url: '/configuration',
              menuRouteTitle:'DataSource',
              tabData:{tab:'DataSource'},
              parentTitle:'Configuration',
            },
            {
              title: 'Application',
              url: '/configuration',
              menuRouteTitle:'Application',
              tabData:{tab:'Application'},
              parentTitle:'Configuration',
            },
            {
              title: 'Metric',
              url: '/configuration',
              tabData:{tab:'Metric'},
              menuRouteTitle:'Metric',
              parentTitle:'Configuration',
            },
            {
              title: 'Query',
              url: '/configuration',
              tabData:{tab:'Query'},
              menuRouteTitle:'Query',
              parentTitle:'Configuration',
            },
            {
              title: 'Threshold',
              url: '/configuration',
              menuRouteTitle:'Threshold',
              tabData:{tab:'Threshold'},
              parentTitle:'Configuration',
            },
            {
              title: 'Notifications',
              url: '/configuration',
              menuRouteTitle:'Notifications',
              tabData:{tab:'Notifications'},
              parentTitle:'Configuration',
            },
            {
              title: 'DC Failover',
              url: '/configuration',
              menuRouteTitle:'DcOverride',
              tabData:{tab:'DcOverride'},
              parentTitle:'Configuration',
            },
          ]
        },
        {
          title: 'SOG configuration',
          parentTitle:'Configuration',
          submenu:[
            {
              title: 'Define Section',
              url: '/sogConfiguration/sections',
              menuRouteTitle:'/sogConfiguration/sections',
              parentTitle:'Configuration',
            },
            {
              title: 'Define Channel',
              url: '/sogConfiguration/channels',
              menuRouteTitle:'/sogConfiguration/channels',
              parentTitle:'Configuration',
            },
            {
              title: 'Define Panel',
              url: '/sogConfiguration/panels',
              menuRouteTitle:'/sogConfiguration/panels',
              parentTitle:'Configuration',
            },
            {
              title: 'Configure Rules and Policies',
              url: '/rulesAndPolicyConfig/rules',
              menuRouteTitle:'/rulesAndPolicyConfig/rules',
              parentTitle:'Configuration',
            }
          ]
        }
      ],
    },
];

const SubMenuItem = ({ title, url }) => {
  return (
    <li>
      {url ? <Link to={url}>{title}</Link> : <span>{title}</span>}
    </li>
  );
};

const SubMenu = ({ submenu }) => {
  return (
    <ul>
      {submenu.map((item, index) => (
        <li key={index}>
          <NavItem title={item.title} submenu={item.submenu} url={item.url} />
        </li>
      ))}
    </ul>
  );
};

const NavItem = ({ title, submenu, url }) => {
  const [active, setActive] = useState(false);

  const handleItemClick = () => {
    setActive(!active);
  };

  return (
    <div>
      <span onClick={handleItemClick}>{title}</span>
      {active && submenu && <SubMenu submenu={submenu} />}
      {url && active && <Link to={url}></Link>}
    </div>
  );
};

const Navigation = ({ navItems }) => {
  return (
    <div style={headerStyles}>
        <div style={headerItemStyles}>
        <span style={{ fontSize: '2.5rem', fontWeight: 'bold', display: 'flex', alignItems: 'center' }}>
            <img src={logo} alt="logo" style={logoStyles} />
            <span>
              <span style={{ fontSize: '1.5rem', marginLeft: '1rem', cursor: 'pointer' }} onClick={() => setDisplayChart(false)}>
                <ul>
                  {navItems.map((item, index) => (
                    <li key={index}>
                      <NavItem title={item.title} submenu={item.submenu} url={item.url} />
                    </li>
                  ))}
                </ul>
              </span>
            </span>
          </span>

        </div>
        </div>
  );
};

const App = () => {
  return (
    <Router>
      <Navigation navItems={navItems} />
    </Router>
  );
};

export default App;
